In selene, lints are created in isolated modules. To start, create a file in selene-lib/src/lints with the name of your lint. In this example, we're going to call the lint cool_lint.rs. Let's now understand what a lint consists of. selene takes lints in the form of structs that implement the Lint trait. The Lint trait expects: A Config associated type that defines what the configuration format is expected to be. Whatever you pass must be deserializable . An Error associated type that implements std::error::Error . This is used if configurations can be invalid (such as a parameter only being a number within a range). Most of the time, configurations cannot be invalid (other than deserializing errors, which are handled by selene), and so you can set this to std::convert::Infallible . A SEVERITY constant which is either Severity::Error or Severity::Warning. Use Error if the code is positively impossible to be correct. A LINT_TYPE constant which is either Complexity, Correctness, Performance, or Style. So far not used for anything. A new function with the signature fn new(config: Self::Config) -> Result<Self, Self::Error>. With the selene CLI, this is called once. A pass function with the signature fn pass(&self, ast: &full_moon::ast::Ast, context: &Context, ast_context: &AstContext) -> Vec<Diagnostic>. The ast argument is the full-moon representation of the code. The context argument provides optional additional information, such as the standard library being used. The ast_context argument provides context specific to that AST, such as its scopes. Any Diagnostic structs returned here are displayed to the user. For our purposes, we're going to write: use super::*;
use std::convert::Infallible; struct CoolLint; impl Lint for CoolLint { type Config = (); type Error = Infallible; const SEVERITY: Severity = Severity::Warning; const LINT_TYPE: LintType = LintType::Style; fn new(_: Self::Config) -> Result<Self, Self::Error> { Ok(CoolLint) } fn pass(&self, ast: &Ast, _: &Context, _: &AstContext) -> Vec<Diagnostic> { unimplemented!() }
} The implementation of pass is completely up to you, but there are a few common patterns. Creating a visitor over the ast provided and creating diagnostics based off of that. See divide_by_zero and suspicious_reverse_loop for straight forward examples. Using the ScopeManager struct to lint based off of usage of variables and references. See shadowing and global_usage .

